import React, {useEffect, useState} from "react";
import styles from "./location.module.scss";
import {useRouter} from "next/router";
import {ContainerCardDeck} from "../../../components/containerCardDeck/ContainerCardDeck.js";
import {fetchContainers} from "../../../utils/api";

const initialState = {
  isLoding: false,
  data: [],
  error: null,
};

export default function locationValue() {
  const routerObject = useRouter();
  const [state, setState] = useState(initialState);
  const {location} = routerObject.query;
  const slotText = styles.slot;
  const noSlot = styles.slot;

  useEffect(() => {
    async function fetch() {
      try {
        setState({...state, isLoading: true});
        if ({location}) {
          const response = await fetchContainers({location});
          setState({...state, isLoading: false, data: response.data});
          if (response.data) {
            noSlotText = styles.displayNone;
            slotText = styles.display;
          }
        } else {
        }
      } catch (error) {
        setState({...state, isLoading: false, error});
      }
    }
    fetch();
  }, [routerObject.query]);

  return (
    <main className={styles.main}>
      <h1 className={(styles.h1, styles.hideH1)}>Tillgängliga förråd i {location}</h1>
      <h1 className={noSlot}>Det finns tyvärr inga lediga förråd i {location}</h1>
      <div className={styles.wrapper}>
        <ContainerCardDeck containers={state.data} />
      </div>
    </main>
  );
}
